column8:
弊社は楽天市場店の他に店頭や雑誌広告でも通信販売を行っており、<br>
タイミングによっては商品が欠品になっている可能性もあります。<br>
購入手続きが完了してもすでに完売となっている場合、納期が掛かる事をご了承ください。<br>
実際の在庫状況等については受注確認メールでご案内いたします。再販ランドクルーザーピックアップGRJ79対応！！<br>ラグジュアリー系ホイールで有名な<br>
（株）クリムソンからデビューしたディーン クロスカントリー<br>
鉄ホイールのようなレトロデザインのアルミホイールです。<br>
ランドクルーザー40、60、70の内前後リーフスプリングモデル、<br>
ランクル70プラド等のオーバーフェンダー無しの<br>
ナローボディー車にバッチリ装着できる<br>
6.5J-16のマイナス5サイズと、マイナーチャンジ後の<br>
ランドクルーザー70前コイル後リーフモデルの<br>
ナローボディー専用のP.C.D.150 5穴のプラス25の<br>
2種類を用意しました。<br>
ご注文時には必要なタイプをご指定ください。<br>
装着写真はイメージです。実際の物とは異なります。<br>
同じホイールの色違い（マーガレットホワイトAW-42）もあります。<br>
フリーホイールハブ付き車にも取り付け可能なように、<br>
センターキャップの中央部分だけ別体で取り外し可能です。<br>
表示価格は標準装備の付属品付きで4本セットの価格です。<br>
ご注文後にメーカーより取り寄せします。<br>
納期が掛かる場合がございますので、あらかじめご了承ください。<!-- ここから リア受 -->
