弊社は楽天市場店の他に店頭や雑誌広告でも通信販売を行っており、<br>
タイミングによっては商品が欠品になっている可能性もあります。<br>
購入手続きが完了してもすでに完売となっている場合、納期が掛かる事をご了承ください。<br>
実際の在庫状況等については受注確認メールでご案内いたします。F1のレーシングカー用ホイールを製造していることで知られる。<br>
名門ホイールメーカー「RAYS」製の
<br>FJクルーザーに装着可能なホイールです。<br>
当然ながら安心のMADE IN JAPANです。<br>
レイズがリリースするデイトナシリーズに<br>
待望のFJクルーザー対応バージョンが登場します。<br>
エッジの効いたシャープなデザインは、<br>
ダイヤモンドカットシリーズです。<br>
スポークを外広がりに見せ、リム部までカバーすることで、<br>
実際よりもホイール径を大きく見せる効果があります。<br>
ご注文後にメーカーより取り寄せします。<br>
納期が掛かる場合がございますので、<br>
あらかじめご了承ください。<br>
120/150プラドや215サーフ用、<br>
にも装着可能です。<!-- ここから リア受 -->
