購入手続きが完了してもすでに完売となっている場合、納期が掛かる事をご了承ください。<br>
実際の在庫状況等については受注確認メールでご案内いたします。ラグジュアリー系ホイールで有名な<br>
（株）クリムソンからデビューした<br>
FJクルーザーのために製作されたかのようなホイールです。<br>
8J-17インチ、インセットは25で<br>
純正状態のFJクルーザーにもバッチリ装着できます。<br>
表示価格は標準装備の付属品付きで4本セットの価格です。<br>
標準装備のクロームバージョンのインサートキャップ以外にも、<br>
レッド、ホワイト、ブルー、イエローの<br>
インサートキャップがオプションでございます。<br>
オプションのインサートキャップが必要な場合は、<br>
ご注文時にお知らせください。<br>
4枚定価\10,500のところを\8,400で販売します。<br>
ホイール及びどのタイプのインサートキャップも<br>ご注文後にメーカーより取り寄せします。<br>
納期が掛かる場合がございますので、あらかじめご了承ください。<br>
FJクルーザー以外の車両用、<br>
7J-16/8J-16/7J-17/8.5J-18等のラインナップもあります。<!-- ここから リア受 -->
